import React from "react";
import { Bar } from "react-chartjs-2";

function Chart() {
  return (
    <div>
      <Bar
        data={{
          labels: ["Ponedeljak", "Utorak", "Sreda"],
        }}
        height={200}
        width={300}
      />
    </div>
  );
}

export default Chart;
